description:
Love Stories (Mason, Erotica X / WebDl / 2014)

Love Stories Volume 1, directed by the award winning Mason, is an exceptional celebration of passion, ardor, and romantic devotion. The movie features a collection of creative and sensual cinematic vignettes in beautiful locations. Starring Dani Daniels, Maddy O'Reilly, Presley Hart and Kimber Day. Do not miss this enchanting and tantalizing portrayal of real couples immersed in tenderness and sensuality.

Dani Daniels, Kimber Day, Maddy O'Reilly, Presley Hart

